import React from "react";
import covidStyle from "../../styles/content/covidStyle";

const CountryButton = ({ clickEventCountry }) => {
  return (
    <div>
      <ul>
        <li style={covidStyle.bListliStyle}>
          <button value="Japan" onClick={clickEventCountry}>
            Japan
          </button>
        </li>
        <li style={covidStyle.bListliStyle}>
          <button value="Philippines" onClick={clickEventCountry}>
            Philippines
          </button>
        </li>
      </ul>
    </div>
  );
};

export default CountryButton;
